import React, {useState,useEffect} from 'react';
import axios from 'axios'
import { Typography, Button, TextField, Paper } from '@material-ui/core';


function Customers(){

  const [data,setData] = useState({})

  useEffect(async()=>{
   await fetch('http://www.omdbapi.com/?s=Dexter&apikey=6496123e')
   .then((res)=>res.json())
   .then((data)=>setData(data.Search))
  },[])

  return(
    <div>
      <Typography 
      variant = "h2"
      align = "center"
      color = "primary"
      >
        Customers
      </Typography>
      <Button 
       variant = "contained"
       color = "secondary"
       onClick = {()=> {setData}}
      >
       Click me
      </Button>

      <ul>
        <h2>{data.Year}</h2>
      </ul>
    </div>
  )
}
export default Customers;
